// Lambda style
NSNotificationCenter.DefaultCenter.AddObserver (
        NSWindow.DidBecomeKeyNotification, (notification) => {Console.WriteLine ("Received the notification NSWindow", notification); }


// Method style
void Callback (NSNotification notification)
{
    Console.WriteLine ("Received a notification NSWindow", notification);
}

void Setup ()
{
    NSNotificationCenter.DefaultCenter.AddObserver (NSWindow.DidBecomeKeyNotification, Callback);
}

